class Solution(object):
    def numDecodings(self, s):
        """
        :type s: str
        :rtype: int
        """
        if len(s) == 0 or s[0] == 0: return 0
        prev_prev = 0
        prev = 1
        current = 0
        for k in range(len(s) - 1, -1, -1):
            if s[k] == '0':
                current = 0
            elif s[k] == '*':
                current = 9*prev
            else:
                current = prev

            loop_count = 0
            if k + 1 < len(s):

                if (s[k] == '1' and ('0' <= s[k + 1] <= '9')) or (s[k] == '2' and ('0' <= s[k + 1] < '7')):
                    loop_count = 1
                elif s[k] == '*' and s[k + 1] == '*':
                    loop_count = 15
                elif s[k] == '*' and '0' <= s[k + 1] <= '6':
                    loop_count = 2
                elif s[k] == '*' and '7' <= s[k + 1] <= '9':
                    loop_count = 1          
                elif s[k] == '1' and s[k + 1] == '*':
                    loop_count = 9
                elif s[k] == '2' and s[k + 1] == '*':
                    loop_count = 6

            current = (current + prev_prev * loop_count)% (10**9 + 7)
            
            prev_prev = prev
            prev = current

        return current 

